#coding:utf-8

"""
ID:          issue-3923
ISSUE:       3923
TITLE:       CHAR(32767) present in XSQLVAR with length 32765
DESCRIPTION:
JIRA:        CORE-3569
FBTEST:      bugs.core_3569
NOTES:
    [11.12.2023] pzotov
    Added 'SQLSTATE' in substitutions: runtime error must not be filtered out by '?!(...)' pattern
    ("negative lookahead assertion", see https://docs.python.org/3/library/re.html#regular-expression-syntax).
    Added 'combine_output = True' in order to see SQLSTATE if any error occurs.
"""

import pytest
from firebird.qa import *

db = db_factory()

test_script = """
    set bail on;
    set sqlda_display on;
    select
    '#abcdefghjklmnopqrstu012345'
    from rdb$database rows 0;

    select
    '#abcdefghjklmnopqrstu0123456'
    from rdb$database rows 0;

    select
    '#abcdefghjklmnopqrstu01234567'
    from rdb$database rows 0;
    
"""

# NB: we must not supress error related to string overflow:
# Statement failed, SQLSTATE = 42000
# -String literal with ... bytes exceeds the maximum length of ... bytes
#
act = isql_act('db', test_script, substitutions = [ ('^((?!(SQLSTATE|exceeds|maximum|limit|sqltype|literal)).)*$', ''), ('[ \t]+', ' ') ] )

expected_stdout = """
    01: sqltype: 452 TEXT scale: 0 subtype: 0 len: 32765 charset: 0 NONE
    01: sqltype: 452 TEXT scale: 0 subtype: 0 len: 32766 charset: 0 NONE
    01: sqltype: 452 TEXT scale: 0 subtype: 0 len: 32767 charset: 0 NONE
"""

@pytest.mark.version('>=3.0')
def test_1(act: Action):
    act.expected_stdout = expected_stdout
    act.execute(combine_output = True)
    assert act.clean_stdout == act.clean_expected_stdout
